import GlobalStyleSheet from '../../../../styleSheet';
import { Row, Col, ListGroup } from 'react-bootstrap'

const Footer = () => (
    <div>
        <div style={styles.footer}>
            <p className="text-center" style={styles.fooeter_text}>
                Copyright@ 2020
                    <span style={{ fontSize: 'medium', fontWeight: 'bold', }}> Muhalik </span>
                - Online Shopping Website
            </p>
            <Row noGutters style={{ margin: '0.5% 4% 0% 4%' }}>
                <Col style={styles.col}>
                    <div>
                        <div><div className='list_text'>List</div></div>
                        <div><div className='list_text'>List</div></div>
                        <div><div className='list_text'>List</div></div>
                        <div><div className='list_text'>List</div></div>
                    </div>
                </Col>
                <Col style={styles.col}>
                    <div>
                        <div><div className='list_text'>List</div></div>
                        <div><div className='list_text'>List</div></div>
                        <div><div className='list_text'>List</div></div>
                        <div><div className='list_text'>List</div></div>
                    </div>
                </Col>
                <Col style={styles.col}>
                    <div style={{ background: 'none' }}>
                        <div><div className='list_text'>List</div></div>
                        <div><div className='list_text'>List</div></div>
                        <div><div className='list_text'>List</div></div>
                        <div><div className='list_text'>List</div></div>
                    </div>
                </Col>
            </Row>
        </div>
        <style jsx>
            {`
                p {
                    margin: 5% 0%
                }
                .list_text {
                    background: none;
                    color: ${GlobalStyleSheet.primary_text_color};
                    font-size: ${GlobalStyleSheet.form_label_fontsize}
                }
            `}
        </style>
    </div>
)

const styles = {
    footer: {
        background: `${GlobalStyleSheet.admin_primry_color}`,
    },
    fooeter_text: {
        margin: '2% 0%',
        fontSize: 'smaller',
        color: 'white'
    },
    col: {
        padding: '1% 3%',
    },
}

export default Footer;
